cors：服务器设置HTTP响应头中Access-Control-Allow-Origin的值，解除跨域限制
iframe：postMessage传递数据、window.name 传值、location.hash 传值、设置document.domain（只能用于二级域名相同的情况下）
websocket：允许跨域通讯
Node 中间件：代理服务器
nginx：高性能的HTTP和反向代理服务器，可以顺便修改 cookie 信息
proxy：webpack配置代理

