函数：前缀为动词 小驼峰can：判断是否可执行某个动作(权限)，返回布尔值
|has：判断是否含有某个值，返回布尔值
is：判断是否为某个值，返回布尔值
ge：获取某个值，返回非布尔值
set：设置某个值
load：加载某些数据，返回无或是否加载完成

类|构造函数：前缀为名称 首字母大写 大驼峰公共属性和方法：跟变量和函数的命名一样
