将右花括号独立放在一行
不要以分号结束一个复杂的声明


对象规则：
将左花括号与类名放在同一行
冒号与属性值间有个空格
字符串使用双引号，数字不需要
最后一个属性-值对后面不要添加逗号
将右花括号独立放在一行
以分号作为结束符号
短的对象代码可以直接写成一行


为了便于阅读每行字符建议小于数 80 个，如果超过 80 个字符，建议在运算符或者逗号后换行



变量

变量必须以字母开头，也能以 $ 和 _ 符号开头（不推荐）
变量名称对大小写敏感
变量声明之后不赋值，默认为undefined
如果重新声明 JavaScript 变量，该变量的值不会丢失var carname="Volvo";
var carname; //值依然是 "Volvo"
function myFunction()
{
  carname1="Volvo";// carname1自动作为全局变量
}


JavaScript 变量均为对象。当您声明一个变量时，就创建了一个新的对象
局部变量在 JavaScript 函数内部声明的变量（使用 var）是局部变量，所以只能在函数内部访问它。（局部作用域）。
您可以在不同的函数中使用名称相同的局部变量，因为只有声明过该变量的函数才能识别出该变量。
只要函数运行完毕，本地变量就会被删除。

全局变量在函数外声明的变量是全局变量，网页上的所有脚本和函数都能访问它（全局作用域）

生存期：生命期从它们被声明的时间开始
局部变量会在函数运行以后被删除
全局变量会在页面关闭后被删除


